import React, { Component } from "react";
import HamburgerNav from "./hamburgernav";

class NavComplete extends Component {
  state = {};
  render() {
    return (
      <div>
        <HamburgerNav />
        <div
          style={{
            backgroundColor: "rgba(252, 186, 3, .8)",
            width: 450,
            height: "163vh",
            position: "absolute",
            right: 0,
            zIndex: 1,
          }}
        ></div>
      </div>
    );
  }
}

export default NavComplete;
